import React from "react";

import { Container, Row, Col } from "reactstrap";
import productsImg from "../../assets/img/secure-5.png";
import CountUp from "react-countup";
import "./cmsclients.css";
import Image from "../../assets/img/illustration.png";
import {constants} from "../../Const" ;
export const CmsClients = (props) =>  {
  if(props.page){
  
  return (
    <section>
      
      <Container>
        <Row>
        <Col lg="6" md="6">
            <div className="products__content">
        
              <h3>Secure and always up-to-date</h3>
              <p>When you’re using Umbraco Cloud, we’ll do everything we can to help you keep your site updated and secure.

Automatic upgrades mean you'll always have the latest features and necessary security fixes. This will make your work simpler, worry-free, and more delightful. We keep your sites up to date with the latest patch release of Umbraco CMS - automatically.

On top of that, you automatically get TLS certificates via Cloudflare - at no extra cost to you. This feature gives you zero-config HTTPS without any added cost or needs to buy an external certificate.</p>
              <button> {props.page.product_2_label1}</button>
              <button>{props.page.product_2_label2}</button>
            </div>
          </Col>

          <Col lg="6" md="6">
          <div className="products__img">
              <img src={productsImg} alt="" className="w-100" />
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
  }
};
